import React from 'react'
import Logo from '../components/Logo'
import Button from '../components/Button'
import './Nav.css'

const Nav = ({onSignOut}) => {
    return (
        <ul className='nav'>
            <li><Logo /></li>
            <li className='fright'><Button text='Sign Out' onClickFunction={onSignOut}/></li>
        </ul>
    )
}

export default Nav;
